import React from 'react';


import Main from './Main';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div id='main'>
      <Main 
        question='Q1.This is the first question'
        type='checkbox'
      />
      <br></br>
      <Main 
        question='Q2.This is the second question'
        type='TrueFalse'
      />
      <br></br>
      <Main 
        question='Q3.This is the third question'
        type='radiobtn'
      />
      <br></br>
    </div>
  );
}

export default App;
